import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from 'react-redux';
import store from './store/store';
import App from './component/App';
import './index.css';

ReactDOM.render(
    <Provider store={store}>
        <App/>
    </Provider>, document.querySelector('#root')
)
